import { EmploiContextProvider } from './context/EmploiContext';
ReactDOM.render(
  <BrowserRouter>
  <EmploiContextProvider>
    <App />
    </EmploiContextProvider>
  </BrowserRouter>,
  document.getElementById('root')
);
